import React, {useState} from 'react';
import axios from "axios";




const LoginForm = () => {

    const handleSubmit = (event) => {
        event.preventDefault();
        axios.post("http://localhost:5098/CreateArticle", formData)
            .then((response) => {
                console.log(response.data);
            })
            .catch((error) => {
                console.error("Error:", error);
            });
    };

    const [formData, setFormData] = useState({
        login: "",
        password: ""
    });

    const handleChange = (event) => {
        const {name, value} = event.target;
        setFormData((prevFormData) => ({
            ...prevFormData,
            [name]: value,
        }));
    };


    return (
        <>
            <div className={"container"}>
                <div className={"row"}>
                    <form onSubmit={handleSubmit}>
                        <div className={"col-xl-12"}>
                            <div className={"row"}>
                                <div className={"offset-xl-3 col-xl-6 mt-3"}>
                                    <input placeholder="Login" className={"form-control"} type="text" id="login"
                                           name="login" value={formData.login} onChange={handleChange}/>
                                </div>
                                <div className={"offset-xl-3 col-xl-6 mt-3"}>
                                    <input placeholder="Login" className={"form-control"} type="text" id="login"
                                           name="login" value={formData.login} onChange={handleChange}/>
                                </div>
                            </div>
                        </div>
                    </form>
                </div>
            </div>
        </>
    );
};

export default LoginForm;
